import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Homepage from './Homepage';
import { Container, Row, Col } from 'react-bootstrap';
import foodImages from './FoodImages';
import './images.css';

import transparentVideo from './'; // Import your transparent video file

export default function MainPage() {
  const navigate = useNavigate();

  const handleImageClick = (type) => {
    if (type === 'biryani') {
      navigate('/biryanis');
    } else if (type === 'pizzas') {
      navigate('/offers');
    }
  };

  return (
    <Container>
      <Row>
        {foodImages.map((foodImage, index) => (
          <Col lg={4} key={index} style={{ marginBottom: '10rem' }}>
            <div className='image-container' onClick={() => handleImageClick(foodImage.type)}>
              {foodImage.image}
              <h1>{foodImage.type}</h1>
            </div>
          </Col>
        ))}
      </Row>
      <video
        autoPlay
        loop
        muted
        playsInline
        style={{
          position: 'fixed',
          bottom: 0,
          right: 0,
          minWidth: '100%',
          minHeight: '100%',
          width: 'auto',
          height: 'auto',
          zIndex: -1000,
          opacity: 0.5, // Set the opacity for transparency
        }}
      >
        <source src={transparentVideo} type='video/webm' />
        Your browser does not support the video tag.
      </video>
    </Container>
  );
}
